import{_ as i,b as l}from"./app.28445bf9.js";const e={},t=l('<h1 id="esbuild-\u4ECB\u7ECD" tabindex="-1"><a class="header-anchor" href="#esbuild-\u4ECB\u7ECD" aria-hidden="true">#</a> Esbuild \u4ECB\u7ECD</h1><p>Esbuild \u4F5C\u4E3A vite \u7684\u53CC\u5F15\u64CE\u4E4B\u4E00, \u5728\u5F88\u591A\u5173\u952E\u7684\u6784\u5EFA\u9636\u6BB5(\u5982 <code>\u4F9D\u8D56\u9884\u7F16\u8BD1</code>, <code>TS \u8BED\u6CD5\u8F6C\u8BD1</code>, <code>\u4EE3\u7801\u538B\u7F29</code>) \u8BA9 vite \u83B7\u5F97\u4E86\u76F8\u5F53\u4F18\u5F02\u7684\u6027\u80FD, \u662F vite \u9AD8\u6027\u80FD\u7684\u5F97\u529B\u5E2E\u624B. \u65E0\u8BBA\u662F\u5728 vite \u914D\u7F6E\u9879\u8FD8\u662F\u6E90\u7801\u5B9E\u73B0\u4E2D, \u90FD\u5305\u542B\u4E86\u4E0D\u5C11 Esbuild \u672C\u8EAB\u7684\u57FA\u672C\u6982\u5FF5\u548C\u9AD8\u9636\u7528\u6CD5</p><h2 id="\u4E3A\u4EC0\u4E48-esbuild-\u6027\u80FD\u8FD9\u4E48\u7A81\u51FA" tabindex="-1"><a class="header-anchor" href="#\u4E3A\u4EC0\u4E48-esbuild-\u6027\u80FD\u8FD9\u4E48\u7A81\u51FA" aria-hidden="true">#</a> \u4E3A\u4EC0\u4E48 Esbuild \u6027\u80FD\u8FD9\u4E48\u7A81\u51FA</h2><p>Esbuild \u662F\u57FA\u4E8E Golang \u5F00\u53D1\u7684\u4E00\u6B3E\u6253\u5305\u5DE5\u5177, \u76F8\u6BD4\u4F20\u7EDF\u7684\u6253\u5305\u5DE5\u5177, \u4E3B\u6253\u6027\u80FD\u4F18\u52BF, \u5728\u6784\u5EFA\u901F\u5EA6\u4E0A\u6BD4\u4F20\u7EDF\u5DE5\u5177\u5FEB <code>10~100</code> \u500D. \u90A3\u4E48, \u5B83\u662F\u600E\u4E48\u4F1A\u8FD9\u4E48\u5FEB\u7684\u5462, \u4E3B\u8981\u53EF\u4EE5\u5305\u62EC\u6210 4 \u70B9:</p><ul><li><ol><li><strong>\u4F7F\u7528 Golang \u5F00\u53D1</strong></li></ol><p>\u6784\u5EFA\u903B\u8F91\u4EE3\u7801\u76F4\u63A5\u88AB\u7F16\u8BD1\u4E3A\u539F\u751F\u673A\u5668\u7801, \u800C\u4E0D\u7528\u50CF js \u4E00\u6837\u5148\u4EE3\u7801\u89E3\u6790\u4E3A\u5B57\u8282\u7801, \u7136\u540E\u8F6C\u6362\u4E3A \u673A\u5668\u7801, \u5927\u5927\u8282\u7701\u4E86\u7A0B\u5E8F\u8FD0\u884C\u65F6\u95F4</p></li><li><ol start="2"><li><strong>\u591A\u6838\u5E76\u884C</strong></li></ol><p>\u5185\u90E8\u6253\u5305\u7B97\u6CD5\u5145\u5206\u5229\u7528\u591A\u6838 cpu \u4F18\u52BF, \u6240\u6709\u7684\u6B65\u9AA4\u5C3D\u53EF\u80FD\u5E76\u884C, \u8FD9\u4E5F\u662F\u5F97\u76CA\u4E8E go \u5F53\u4E2D\u591A\u7EBF\u7A0B\u5171\u4EAB\u5185\u5B58\u7684\u4F18\u52BF</p></li><li><ol start="3"><li><strong>\u4ECE\u96F6\u9020\u8F6E\u5B50</strong></li></ol><p>\u51E0\u4E4E\u6CA1\u6709\u4F7F\u7528\u4EFB\u4F55\u7B2C\u4E09\u65B9\u5E93, \u6240\u6709\u903B\u8F91\u81EA\u5DF1\u7F16\u5199, \u5927\u5230 AST \u89E3\u6790, \u5C0F\u5230\u5B57\u7B26\u4E32\u7684\u64CD\u4F5C, \u4FDD\u8BC1\u6781\u81F4\u7684\u4EE3\u7801\u6027\u80FD</p></li><li><ol start="4"><li><strong>\u9AD8\u6548\u7684\u5185\u5B58\u5229\u7528</strong></li></ol><p>Esbuild \u4E2D\u4ECE\u5934\u5230\u5C3E\u5C3D\u53EF\u80FD\u5730\u590D\u7528\u4E00\u4EFD AST \u8282\u70B9\u6570\u636E, \u800C\u4E0D\u7528\u50CF JS \u6253\u5305\u5DE5\u5177\u4E2D\u9891\u7E41\u5730\u89E3\u6790\u548C\u4F20\u9012 AST \u6570\u636E(\u5982 string -&gt; ts -&gt; js -&gt; string), \u9020\u6210\u5185\u5B58\u5927\u91CF\u6D6A\u8D39</p></li></ul>',5);function s(o,d){return t}var a=i(e,[["render",s],["__file","1.Esbuild\u4ECB\u7ECD.html.vue"]]);export{a as default};
